import React from "react";

const EndGame = ( { changeGameState, exitGame } ) => {
  return (
    <div className='modal'>
      <button onClick={changeGameState}>
        Start another game
      </button>

      <button onClick={exitGame}>Exit game</button>
    </div>
  );
};

export default EndGame;
